import React from 'react';
import { Row, Col, Image} from 'react-bootstrap';
import logo from './nvidia-logo.jpeg';

const Header = () => {

  return(
    <div>
      <Row>
        <Col xs="6">Nvidia</Col>
        <Col xs="6">
          <Image src="./nvidia-logo.jpeg" roundedCircle></Image>
        </Col>
      </Row>
    </div>
  );
}

export default Header;
